import Vue  from 'vue'
import App from './App.vue'
// import * as VueGoogleMaps from 'vue3-google-maps'

Vue.config.productionTip = false

Vue.use(VueGoogleMaps, {
    load: {
      key: 'AIzaSyBhxa94GfjGZdtqllKjEoF0Uq86RAAeBpo',
      libraries: 'places',
    }
  });

  new Vue({
    render: h => h(App),
  }).$mount('#app')
